import React from 'react'
import style from './student.module.css'

function StudentProfile() {
  return (
    <div id={style.stdmainForm}>
        <form action="" id={style.stpForm}></form>
        <label htmlFor="">Student </label>
    </div>
  )
}

export default StudentProfile
